  return (
    <Container>
      <Background>
        <img src='/images/Disney.jpg'/>
      </Background>
    </Container>
  )
}

export default Detail

const Container = styled.div`
    min-height: calc(100vh- 70px);
    padding: 0 calc(3.5vw + 5px)
    position: relatife

`

const Background = styled.div`
    position: fixed;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
`
